/* eslint-disable no-unused-vars */
import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Link, useHistory } from 'react-router-dom';
import Table from 'react-bootstrap/Table';

export default function SleepyGet() {
  const dispatch = useDispatch();
  const name = useSelector((state) => state.auth.name);
  const kidName = useSelector((state) => state.auth.nameKid);
  const sleepy = useSelector((state) => state.sleepy);

  return (
    <div
      className="h-auto p-5 text-white bg-dark"
      style={{
        position: 'absolute',
        display: 'inline-block',
        width: '100%',
        marginTop: '5%',
        float: 'left',
      }}
    >
      <Table bordered hover className="sleepy-table">
        <thead>
          <tr>
            <th>Date</th>
            <th>Age</th>
            <th>Wake-up</th>
            <th>Bed-time</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{sleepy[0].date}</td>
            <td>{sleepy[0].age}</td>
            <td>{sleepy[0].wakeUp}</td>
            <td>{sleepy[0].bedTime}</td>
          </tr>
        </tbody>
      </Table>
    </div>
  );
}
